import React from 'react';

const About = () => {
    return (
        <section id="about" className="py-20 bg-gray-100">
            <div className="container mx-auto px-4">
                <h2 className="text-3xl font-bold text-center">About Me</h2>
                <p className="mt-4 text-center text-gray-700">I'm a passionate web developer with experience in creating dynamic, responsive websites using the latest technologies.</p>
            </div>
        </section>
    );
};

export default About;
